script: |
  super -f text -I q12925.spq | sort > q12925.out

inputs:
  - name: q12925.spq
    data: |
      SELECT col2 * + 2 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT 58 IS NULL AND + col1 - 23 + col1 * - col1 NOT BETWEEN col0 AND ( + ( col0 ) + - 29 );
  - name: tab0

outputs:
  - name: q12925.out
    data: |
      198
      20
      94
